import React from 'react';

import Card from '../components/UI/Card';

import classes from './MealMenu.module.css';

const MENU = [
  {
    id: "m1",
    name: "Jollof Rice",
    description: "Delicious",
    price: 3500,
  },
  {
    id: "m2",
    name: "Bread Fruit",
    description: "Specialty and tasty!",
    price: 4000,
  },
  {
    id: "m3",
    name: "Fish Barbecue",
    description: "A special Nigerian delicacy",
    price: 9500,
  },
  {
    id: "m4",
    name: "Fried Rice",
    description: "Healthy...and green...",
    price: 3500,
  },
];

const MealMenu = () => {
    return (
      <Card>
        <section className={classes.meals}>
          <ul>
            {MENU.map((meal) => (
              <li>{`${meal.name} ${meal.price}`}</li>
            ))}
          </ul>
        </section>
      </Card>
    );
};

export default MealMenu;
